INSERT INTO `v1_574186f338b4c1b1b3bb24666fa44f2b239c7af8918f4e46f239458fcd7232a0` VALUES (/*3876c3b82a8bae4f8768b94511454bcd5f104115c89cd6f5671a8283c96d46fd*/2003901, /*91697b196b75150846887f21e142b8c9074fdfdcbc2a71e0e9d91a9386d6f43d*/2003901, /*bf47df6f1a110edf62739d47bf0b894bf01d95847a41430f7475e058b8c2c956*/"主さまが宿題に励んでおられるようです。\n宿題が終わるまでモンスターの攻撃を耐え抜けば勝利となりますよ。\n宿題がどこまで進んでいるかは画面のゲージを確認しましょう。	");
